params ["_unit", "_bullet_trail_mg", "_bullet_trail_cannon", "_bullet_trail_turret", "_unit_pos"];

_unit = _this select 0;

_bullet_trail_mg = _unit getVariable['use_bullet_trail_mg', 0];				//use bullet trails on mgs
_bullet_trail_cannon = _unit getVariable['use_bullet_trail_cannon', 0];		//use bullet trail on cannons
_bullet_trail_turret = _unit getVariable['use_bullet_trail_turret', 0];		//use bullet trail on turrets

//2x mg-17 7.92mm
if (_bullet_trail_mg >= 1) then
{
	_unit removeMagazineTurret ["JU_87_2000Rnd_MG_17_792mm", [-1]];
	_unit addMagazineTurret ["JU_87_2000Rnd_MG_17_792mm_Trail", [-1]];
};

//2x mg-151 20mm
if (_bullet_trail_cannon >= 1) then
{
	_unit removeMagazineTurret ["JU_87_1000Rnd_MG_151_20mm", [-1]];
	_unit addMagazineTurret ["JU_87_1000Rnd_MG_151_20mm_Trail", [-1]];
};

//2x mg-81 7.92mm
if (_bullet_trail_turret >= 1) then
{
	_unit removeMagazineTurret ["JU_87_2000Rnd_MG_81_792mm", [0]];
	_unit addMagazineTurret ["JU_87_2000Rnd_MG_81_792mm_Trail", [0]];
};

//function calls/spawns load the game much faster than execVM cammands

if (alive _unit && (_unit getVariable['attach_siren', 1] == 1)) then
{
	_unit setVariable ['add_siren_action', 0];	//tells stuka siren script not to add user actions, this is for non-patched stukas
	[_unit] spawn LIB_fnc_Stuka_Siren;		//call the siren function from this script instead of the Ju-87's eventhandler class; if placed in eventhandler, the game may go into an infinite loading screen at the start/end of a mission or take a long time to load
};

//checks if user is in Eden Preview (singleplayer/multiplayer) and not in the editor and if the engine is off
//this fixes a bug when using the next lines of code, else the plane will keep increasing its height every time the user returns to the editor
if (is3DENPreview && !isEngineOn _unit) then
{
	_unit_pos = getPosATL _unit;		//get plane position
	_unit setPosATL [_unit_pos select 0, _unit_pos select 1, (_unit_pos select 2) + 1];		//increase height by 1
};

#include <iostream>

using namespace std;

int main() {
    int won = 0, lost = 0, drawn = 0;

    string gameResult;

    for (int i = 0; i < 3; i++) {
        cin >> gameResult;

        int teamOneResult = (int)gameResult[0];
        int teamTwoResult = (int)gameResult[2];

        if (teamOneResult > teamTwoResult) {
            won++;
        }
        else if (teamTwoResult > teamOneResult) {
            lost++;
        }
        else {
            drawn++;
        }
    }

    cout << "Team won " << won << " games.\n"
        << "Team lost " << lost << " games.\n"
        << "Drawn games: " << drawn << endl;

    return 0;
}

class Employee {
    public int computeSalary() {
        return 1000;
    }
    final void doTheJob() {
        System.out.println("WORK!");
    }
}

interface IEmpWithBonus {
    default int getBonusSalary() {
        return 100;
    }
}

class PermanentEmployee extends Employee implements IEmpWithBonus {
    @Override
    public int computeSalary() {
        return super.computeSalary() * 2;
    }
}

class Intern extends Employee {
    @Override
    public int computeSalary() {
        return super.computeSalary() / 2;
    }
}

public class Main {

    public static void main(String[] args) {
        PermanentEmployee permanentEmployee = new PermanentEmployee();
        System.out.println(permanentEmployee.getBonusSalary());
        Intern intern = new Intern();
        System.out.println(intern.computeSalary());
    }
}

