#include <iostream>
#include <iomanip>
#include <windows.h>
int main()
{
    SetConsoleOutputCP(1251);//Позволяет программе "понимать" вводимые русские символы.
    //Инициализация переменных.
    int N = 0; //Натуральное число, введенное пользователем.                    //с маленькой буква переменные в плюсах
    double Sum = 0; //Искомая сумма.                                            //и тут
    bool IsIncorrect = true; //Проверка на коректрость введенных данных.        //и тут

    std::cout << "Программа считает сумму всех членов последовательности вида: 1+1/2+...+1/n.\n\n"; //Цель программы.
    while (IsIncorrect) {
        IsIncorrect = false;
        std::cout << "Введите натуральное число:";
        std::cin >> N; //Считывание данных с консоли.
        if (std::cin.fail()) {//Проверка на правильность первого символа.
            std::cin.clear();//С помощью этой функции, мы восстановили проверку на ввод в состояние по умолчанию.
            while (std::cin.get() != '\n');//Проверка без пропуска пробелов.
            IsIncorrect = true;//Исключение последующих проверок на ввод.
            std::cout << "\nНекорректно введенные данные. Попробуйте еще раз.\n";//Вывод ошибки.
        }

        if (!IsIncorrect && std::cin.get() != '\n') {//Проверка на ввод если пользователь ввел более одного символа.
            std::cin.clear();//С помощью этой функции, мы восстановили проверку на ввод в состояние по умолчанию.
            while (std::cin.get() != '\n');//Проверка на ввод если пользователь ввел более одного символа.
            std::cout << "\nНекорректно введенные данные. Попробуйте еще раз.\n";//Вывод ошибки.
            IsIncorrect = true;//Исключение последующих проверок на ввод.
        }

        if (!IsIncorrect && N < 1) {//Проверка случая, если пользователь ввел число, меньше 0.
            IsIncorrect = true;//Исключение последующих проверок на ввод.
            std::cout << "\nНекорректно введенные данные. Попробуйте еще раз.\n";//Вывод ошибки.        //определить тип ошибки  было бы славно -- где именно пользователь не попал. Например, нет верхней границы ввода, нижняя объявлена, но не прописана для пользователя в сообщении
        }
    }

    for (double i = 1; i <= N; i++) {//Подсчет суммы элементов последовательности.      //счетчики обычно берутся целым числом
                                                                                        //более того, нестрогое значение при вещественном числе -- бан
                                                                                        //нестрогое неравенство тоже надо заменить на строгое, иначе бан
        Sum = Sum + 1 / i;      //вот это запись a = a + n эквивалентна записи a += n;  
                                //это не обязательно, даже в процессе кодинга такую запись использовать приятнее и понятнее
    }
    std::cout << "\nСумма членов заданной последовательности равна:";
    std::cout << std::setprecision(5) << std::fixed; //Фиксирование пяти знаков после запятой.      //если я не ошибаюсь, то все эти строчки можно объединить в одну
    std::cout << Sum;//Вывод значения.                                                                 //было бы лучше со стороны экономии бумаги для печати, да и интуитивнее понятнее бы стало
    std::cout << ".\n";                                                                                 //чем такой разбитый ответ
}

